import './App.css';
import {addData} from './redux/Actions/home';
import { useDispatch, useSelector } from 'react-redux';


function App() {
  const dispatch = useDispatch();
  return (
    <div className="App">
      <button onClick={()=> dispatch(addData())}>Add data</button>
    </div>
  );
}

export default App;
